import {
  CREATE_STREAM,
  JOIN_STREAM,
  GET_STREAM
} from '../types'

export default (state, action) => {
  switch (action.type) {
    case GET_STREAM: 
      return {
        ...state
      }
    default: 
      return {
        ...state
      }
  }
}
